	public static class Point {
		private int x;
		private int y;

		public Point(int x, int y) {
			super();
			this.x = x;
			this.y = y;
		}

		public int getX() {
			return x;
		}

		public void setX(int x) {
			this.x = x;
		}

		public int getY() {
			return y;
		}

		public void setY(int y) {
			this.y = y;
		}

	}

	private static class Gray8DetectHaarMultiScale extends PipelineStage {
		private final HaarClassifierCascade hcc;
		// maximum scale is the largest factor the image is divided by
		private int nMaxScale = 10;
		// minimum scale is the smallest factor the image is divided by
		private int nMinScale = 5;
		// scale change is the change in scale from one search to the next
		// times 256
		private final int nScaleChange = 300;

		/**
		 * Creates a new instance of Gray8DetectHaarMultiScale. The scale parameters correspond to the size of a square area in the original input image that are averaged to create a single pixel in the image used for detection. A scale factor of 1 would do detection at full image resolution.
		 * 
		 * @param is
		 *            Input stream containing the Haar cascade. This input stream is created by the Haar2J2me program (run on a PC) from a Haar cascade that has been trained using the OpenCV. See {http://sourceforge.net/projects/opencv} for more information about the OpenCV. The Haar2J2me program should be available wherever you got this code from.
		 * @param nMinScale
		 *            Minimum (finest) scale at which features will be detected.
		 * @param nMaxScale
		 *            Maximum (coarsest) scale at which features will be detected.
		 * @throws jjil.core.Error
		 *             if there is an error in the input file.
		 * @throws java.io.IOException
		 *             if there is an I/O error reading the input file.
		 */
		public Gray8DetectHaarMultiScale(InputStream is, int nMinScale, int nMaxScale) throws jjil.core.Error, IOException {
			this.nMinScale = nMinScale;
			this.nMaxScale = nMaxScale;
			// load Haar classifier cascade
			InputStreamReader isr = new InputStreamReader(is);
			this.hcc = HaarClassifierCascade.fromStream(isr);
		}

		/**
		 * Apply multi-scale Haar cascade and prepare a mask image showing where features were detected.
		 * 
		 * @param image
		 *            Input Gray8Image.
		 * @throws jjil.core.Error
		 *             if the input is not a Gray8Image or is too small.
		 */

		@Override
		public void push(Image image) throws jjil.core.Error {
			push(image);
		}

		public List<Rect> pushAndReturn(Image image) throws jjil.core.Error {
			List<Rect> result = new ArrayList<Rect>();
			Gray8Image imGray;
			if (image instanceof Gray8Image) {
				imGray = (Gray8Image) image;
			} else {
				throw new Error(Error.PACKAGE.ALGORITHM, ErrorCodes.IMAGE_NOT_GRAY8IMAGE, image.toString(), null, null);
			}
			if (image.getWidth() < this.hcc.getWidth() || image.getHeight() < this.hcc.getHeight()) {
				throw new Error(Error.PACKAGE.ALGORITHM, ErrorCodes.IMAGE_TOO_SMALL, image.toString(), this.hcc.toString(), null);
			}
			int nScale = Math.min(this.nMaxScale, Math.min(image.getWidth() / this.hcc.getWidth(), image.getHeight() / this.hcc.getHeight()));
			// Zero the mask
			Gray8Image imMask = new Gray8Image(1, 1, Byte.MIN_VALUE);
			while (nScale >= this.nMinScale) {
				// shrink the input image
				int nTargetWidth = imGray.getWidth() / nScale;
				int nTargetHeight = imGray.getHeight() / nScale;
				Gray8Shrink gs = new Gray8Shrink(nTargetWidth, nTargetHeight);
				gs.push(imGray);
				Gray8Image imShrunk = (Gray8Image) gs.getFront();
				// scale the mask to the new size
				Gray8RectStretch grs = new Gray8RectStretch(nTargetWidth, nTargetHeight);
				grs.push(imMask);
				imMask = (Gray8Image) grs.getFront();
				// combine the image and mask to make a masked image
				Gray8MaskedImage gmi = new Gray8MaskedImage(imShrunk, imMask);
				// pass the masked image to a subimage generator
				MaskedGray8SubImgGen mgsi = new MaskedGray8SubImgGen(this.hcc.getWidth(), this.hcc.getHeight(), Math.max(1, gmi.getWidth() / 30), Math.max(1, gmi.getHeight() / 30));
				mgsi.push(gmi);
				// now run Haar detection on each scaled image
				int nxLastFound = -hcc.getWidth();
				int nyLastFound = -hcc.getHeight();
				while (!mgsi.isEmpty()) {
					Gray8OffsetImage imSub = (Gray8OffsetImage) mgsi.getFront();
					// if we've found a feature recently we skip forward until
					// we're outside the masked region. There's no point rerunning
					// the detector
					if (imSub.getXOffset() > nxLastFound + hcc.getWidth() && imSub.getYOffset() > nyLastFound + hcc.getHeight()) {
						if (hcc.eval(imSub)) {
							// Found something.
							nxLastFound = imSub.getXOffset();
							nyLastFound = imSub.getYOffset();
							// assign Byte.MAX_VALUE to the feature area so we don't
							// search it again
							result.add(new Rect(nxLastFound * nScale, nyLastFound * nScale, this.hcc.getWidth() * nScale, this.hcc.getHeight() * nScale));

							Gray8Rect gr = new Gray8Rect(nxLastFound, nyLastFound, this.hcc.getWidth(), this.hcc.getHeight(), Byte.MAX_VALUE);
							gr.push(imMask);
							imMask = (Gray8Image) gr.getFront();
						}
					}
				}
				nScale = nScale * 256 / this.nScaleChange;
			}
			// Stretch imMask to original image size; this is the result
			Gray8RectStretch grs = new Gray8RectStretch(image.getWidth(), image.getHeight());
			grs.push(imMask);
			super.setOutput(grs.getFront());
			return result;
		}

	}

	public static int getXInterest(Collection<Rect> rects) {
		int minX = Integer.MAX_VALUE;
		int maxX = -1;
		for (Rect rect : rects) {
			if (minX > rect.getLeft()) {
				minX = rect.getLeft();
			}
			if (maxX < rect.getRight()) {
				maxX = rect.getRight();
			}
		}
		if (maxX < 0) {
			return -1;
		}
		return minX + (maxX - minX) / 2;
	}

	public static int getYInterest(Collection<Rect> rects) {
		int minY = Integer.MAX_VALUE;
		int maxY = -1;
		for (Rect rect : rects) {
			if (minY > rect.getTop()) {
				minY = rect.getTop();
			}
			if (maxY < rect.getBottom()) {
				maxY = rect.getBottom();
			}
		}
		if (maxY < 0) {
			return -1;
		}
		return minY + (maxY - minY) / 2;
	}

	public static Point getPointOfInterest(BufferedImage img) {
		try {
			InputStream is = new ByteArrayInputStream(HCSB.getBytes());
			Gray8DetectHaarMultiScale detectHaar = new Gray8DetectHaarMultiScale(is, 1, 40);
			RgbImage im = RgbImageJ2se.toRgbImage(img);
			RgbAvgGray toGray = new RgbAvgGray();
			toGray.push(im);
			List<Rect> results = detectHaar.pushAndReturn(toGray.getFront());
			int x = getXInterest(results);
			int y = getYInterest(results);
			if (x < 0 || y < 0) {
				return null;
			} else {
				return new Point(x, y);
			}
		} catch (Throwable e) {
			e.printStackTrace();
			return null;
		}
	}
